import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../hooks/useAuth';
import { useChat } from '../hooks/useChat';
import ChatList from '../components/Chat/ChatList';
import ChatBox from '../components/Chat/ChatBox';
import UserAvatar from '../components/UserAvatar/UserAvatar';
import socket from '../utils/socket';
import './ChatPage.css';

const ChatPage = () => {
  const { user, logout } = useAuth();
  const { 
    chats, 
    selectedChat, 
    setSelectedChat, 
    fetchChats, 
    accessChat,
    notifications,
    removeNotification
  } = useChat();
  const [searchTerm, setSearchTerm] = useState('');
  const [searchResults, setSearchResults] = useState([]);
  const [isSearching, setIsSearching] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    if (!user) {
      navigate('/login');
      return;
    }

    // Connect to socket
    socket.emit('setup', user);

    // Fetch chats
    fetchChats(user.token);

    return () => {
      // Disconnect socket when component unmounts
      socket.off('connected');
    };
  }, [user, navigate, fetchChats]);

  const handleSearchUsers = async () => {
    if (!searchTerm) {
      setSearchResults([]);
      return;
    }

    try {
      setIsSearching(true);
      const response = await fetch(`/api/users?search=${searchTerm}`, {
        method: 'GET',
        headers: {
          Authorization: `Bearer ${user.token}`,
        },
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.message || 'Failed to search users');
      }

      setSearchResults(data);
      setIsSearching(false);
    } catch (error) {
      console.error('Error searching users:', error);
      setIsSearching(false);
    }
  };

  const handleUserSelect = async (userId) => {
    await accessChat(userId, user.token);
    setSearchTerm('');
    setSearchResults([]);
  };

  const handleChatSelect = (chat) => {
    setSelectedChat(chat);

    // Remove notifications for this chat
    if (notifications.some(n => n.chat._id === chat._id)) {
      removeNotification(chat._id);
    }
  };

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <div className="chat-page">
      <div className="sidebar">
        <div className="sidebar-header">
          <div className="user-info">
            <UserAvatar user={user} />
            <span className="username">{user?.username}</span>
          </div>
          <button className="logout-btn" onClick={handleLogout}>
            Logout
          </button>
        </div>

        <div className="search-container">
          <input
            type="text"
            placeholder="Search users..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            onKeyPress={(e) => e.key === 'Enter' && handleSearchUsers()}
          />
          <button onClick={handleSearchUsers}>
            <i className="fas fa-search"></i>
          </button>
        </div>

        {searchResults.length > 0 && (
          <div className="search-results">
            {searchResults.map(user => (
              <div
                key={user._id}
                className="search-user-item"
                onClick={() => handleUserSelect(user._id)}
              >
                <UserAvatar user={user} />
                <div className="user-details">
                  <div className="user-name">{user.username}</div>
                  <div className="user-email">{user.email}</div>
                </div>
              </div>
            ))}
          </div>
        )}

        <ChatList
          chats={chats}
          handleChatSelect={handleChatSelect}
        />
      </div>

      <div className="chat-container">
        <ChatBox chat={selectedChat} />
      </div>
    </div>
  );
};

export default ChatPage;
